import Header from './Header'
import AppContainer from './AppContainer'

const Loading = props => {
  return (
    <div>
      <Header loggedIn={props.loggedIn} />
      <AppContainer>
        <img className="center" src="/images/spinner.gif" />
      </AppContainer>
    </div>
  )
}

export default Loading
